I want you all to meet Starla whose story and transformation is showcased on Dr. 90210. There aren’t enough words to describe how much I love and appreciate Starla and when you get to know her you will understand what I mean.  She has a beautiful soul and energy and I’m so grateful to know her and to be her surgeon.  She inspires me so much as well as so many others on her social media platform by encouraging others who are going through a weight loss journey like herself.  

She had a 200 pound weight loss and her tummy tuck surgery was honestly the most challenging surgery of my entire career.  Her surgery was actually the first one we filmed for the show so the pressure of having cameras on me the whole time with a camera crew being their first time in the OR, working with the largest amount of skin I ever had, plus caring so much about Starla and wanting to make her surgery as perfect as possible - I’ll never forget that day.  I would encourage you all to take some time out of your day and watch this segment to get to know her and her plastic surgery journey. 

